import Item from "./Item";
import { useParams } from "react-router-dom";
import listaProductos from "../data.js";

export default function ItemListContainer() {

    let itemCategory = useParams();

    console.log(itemCategory)

    if (Object.keys(listaProductos).length == 0) {
        return (
            <>
                <h1>Catálogo2</h1>
                <section className="containerItems gap-5">
                    { listaProductos.map((infoProducto) => {
                        return ( infoProducto.items.map((producto) => {
                            return (
                                <Item id={producto.id} img={producto.image} title={producto.name} />
                                )
                            }) 
                        )
                    }) }
                </section>
            </>
        )
    } else {
        return (
            <>
                <h1>Catálogo2</h1>
                <section className="containerItems gap-5">

                    {
                        listaProductos.map((infoProducto) => {
                            return ( infoProducto.items.map((producto) => {
                                return (
                                        <Item id={producto.id} img={producto.image} title={producto.name} />
                                    )
                                })
                            )
                        })
                    }

                </section>
            </>
        )
    }

}
